import React, {useEffect} from 'react';
import Layout from '../../components/Layout';
import { SectionTitle, Pill } from '../../styles';
import {ProjectItem, ProjectTitle, SkillContainer} from './styles';
import {Image} from "../../components/UserHeader/styles";
import {ImageContainer,NonsenseContainer} from "./styles";


const Projects = ({ user }) => {

    useEffect(() => {
        //console.log(user.projects.images[0].resolutions.desktop.url);
        //console.log(user);
        user.projects.map((project, index) => (
            project.images.map((image, j) => (
                console.log(image.resolutions.desktop.url)
                //.map((format, i) =>(
                   //console.log(format)
                //))
            ))
        ));
    }, []);

  return (
    <Layout user={user}>
      <div>
        <SectionTitle>Projects</SectionTitle>
        <ul>
          {user.projects.map((project, i) => (
            <ProjectItem key={i}>
              <ProjectTitle>{project.displayName}</ProjectTitle>
                <SkillContainer>
                    {[...project.languages, ...project.libraries,].map((item, j) => (
                        <Pill key={j}>{item}</Pill>
                    ))}
                </SkillContainer>
                <NonsenseContainer>
                    <p>{project.summary}</p>



                    <ImageContainer src= {project.images.map((image, j) => (
                        image.resolutions.desktop.url
                    ))} />

                </NonsenseContainer>











            </ProjectItem>
          ))}
        </ul>
      </div>
    </Layout>
  );
};

export default Projects;
